import React from "react";
import styled from "styled-components";

const WrapperMenuPlegable = styled.div`
	display: flex;
	flex-direction: column;
	align-items: center;
`;

const WrapperTitle = styled.div`
	display: flex;
`;

const WrapperTitleOptions = styled.div``;

const Arrow = "../../images/downarrow.png";
const ImgDownArrow = styled.img`
	margin-top: 20px;
	width: 40px;
	width: 15px;
	height: 15px;
`;

const Title = styled.p``;

const List = styled.ul`
	// display: none;
	list-style: none;
	padding: 0px;
	position: absolute;
	width: 100px;
	text-align: right;
	margin: 0px 0px 0px -14px;
`;

const ItemList = styled.li`
	margin: 10px 0px;
`;

class Develop extends React.Component {
	render() {
		return (
			<WrapperMenuPlegable>
				<WrapperTitleOptions>
					<WrapperTitle>
						<Title>Solutions</Title>
						<ImgDownArrow src={Arrow} />
					</WrapperTitle>
					<List>
						<ItemList>Solution 1</ItemList>
						<ItemList>Solution 2</ItemList>
						<ItemList>Solution 3</ItemList>
					</List>
				</WrapperTitleOptions>
			</WrapperMenuPlegable>
		);
	}
}

export default Develop;
